package.json.content:
{
  "name": "{{name}}",
  "version": "1.0.0",
  "main": "index.js",
  "repository": {
    "type": "git",
    "url": "https://github.com/{{repo}}.git"
  },
  "devDependencies": {
    "jshint": "^2.5.6",
    "jshint-stylish": "^1.0.0",
    "mocha": "^1.21.4",
    "must": "^0.12.0"
  },
  "scripts": {
    "test": "mocha {{#if harmony}}--harmony {{/if}}--require must && jshint . --exclude-path .gitignore --reporter node_modules/jshint-stylish/stylish.js"
  },
  "author": "{{author}}",
  "license": "BSD-3-Clause",
  "jshintConfig": {
    "node": true,
    "mocha": true{{#if harmony}},
    "esnext": true
    {{/if}}
  }
}
